--
-- AWKWARD ADMISSIONS
--

-- The BIT data type does not seem to work well, so all BIT values are TINYINT UNSIGNED instead.
-- CREATE TRIGGER is not supported in the prepared statement protocol, thus it is implemented in server code rather than a stored procedure.



-- -- --
-- -- -- MONOGRAPHIA USER AND CREATE MAIN ADMINISTRATIVE DATABASE
-- -- --
CREATE OR REPLACE USER 'monographia'@'localhost' IDENTIFIED BY 'Linnaeus';
GRANT SELECT, INSERT, UPDATE, DELETE, EXECUTE, CREATE, CREATE TEMPORARY TABLES, TRIGGER ON *.* TO 'monographia'@'localhost';

FLUSH PRIVILEGES;

SET foreign_key_checks = 0;
DROP DATABASE IF EXISTS `Monographia`;
SET foreign_key_checks = 1;
CREATE DATABASE `Monographia`;
USE Monographia;



-- -- --
-- -- -- SINGLE-COPY ADMINISTRATIVE TABLES
-- -- --

--
-- Messages. Pushed to users upon login and/or homepage landing.
--
SET foreign_key_checks = 0;
DROP TABLE IF EXISTS `Messages`;
SET foreign_key_checks = 1;
CREATE TABLE `Messages` (
	`MessagesID` SMALLINT UNSIGNED NOT NULL AUTO_INCREMENT,
	`Message` VARCHAR(255) NOT NULL,
	`Start` DATETIME NOT NULL,
	`Stop` DATETIME NOT NULL,
	`MessageType` TINYINT UNSIGNED NOT NULL, -- 0 = fatal, 1 = error, 2 = warning, 3 = message
	`LoginMessage` TINYINT UNSIGNED NOT NULL, -- 'false'/'true' upon login
	`LandingMessage` TINYINT UNSIGNED NOT NULL, -- 'false'/'true' upon landing
	PRIMARY KEY (`MessagesID`)
) ENGINE=InnoDB DEFAULT CHARSET=UTF8;



