--
-- Institutions users are affiliated with. Any user can add/edit (hopefully people will behave).
--
SET foreign_key_checks = 0;
DROP TABLE IF EXISTS `Institutions`;
SET foreign_key_checks = 1;
CREATE TABLE `Institutions` (
	`InstitutionID` MEDIUMINT UNSIGNED NOT NULL AUTO_INCREMENT,
	`Institution` VARCHAR(255) NOT NULL UNIQUE,
	`Country` SMALLINT UNSIGNED,
	`Hash` CHAR(16) NOT NULL UNIQUE, -- xxHash(Institution); BINARY storage using UNHEX() did not work correctly
