--
-- Monographia users. Users with stored data cannot be deleted, only deactivated
-- (so that contributed data used by others are not lost). A 'general' user is created
-- for web publication (given read permissions upon 'publication'), subscriptions,
-- and to store login failures of unknown users.
--
SET foreign_key_checks = 0;
DROP TABLE IF EXISTS `Users`;
SET foreign_key_checks = 1;
CREATE TABLE `Users` (
	`UserID` SMALLINT UNSIGNED NOT NULL AUTO_INCREMENT,
	`GivenName` VARCHAR(255) NOT NULL, /* people with only one name are stored here */
	`MiddleName` VARCHAR(255),
	`FamilyName` VARCHAR(255) NULL,
	`ScreenName` VARCHAR(255) NOT NULL,
	`Language` TINYINT UNSIGNED,
	`Email` VARCHAR(255) NOT NULL UNIQUE,
	`PublicKey` VARCHAR(342) NOT NULL UNIQUE, -- SQRL IDentity Key
	`PreviousPublicKey` VARCHAR(342) NOT NULL UNIQUE, -- SQRL Previous IDentity Key
	`Institution` MEDIUMINT UNSIGNED,
	`Status` TINYINT UNSIGNED, -- 'inactive' (0) / 'active' (1) == a user 'kill' switch
	`LastLogin` DATETIME,
	`LastLoginBrowser` CHAR(16) NOT NULL UNIQUE, -- xxHash of browser fingerprint
	`LastFailedLogin` DATETIME,
	`FailedLogins` INT UNSIGNED NOT NULL, -- On login or attempted login, value reset to the number of failures within the last 24 hours (C++ code).
	`LastProject` MEDIUMINT UNSIGNED DEFAULT NULL,
	`DateCreated` DATE DEFAULT NULL,
	`Hash` CHAR(16) NOT NULL UNIQUE, -- xxHash(Email); BINARY storage using UNHEX() did not work correctly
	`TimeStamp` TIMESTAMP DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
	PRIMARY KEY (`UserID`),
	FOREIGN KEY (`Institution`) REFERENCES Monographia.Institutions (`InstitutionID`) ON DELETE SET NULL ON UPDATE CASCADE,
	FOREIGN KEY (`Language`) REFERENCES Monographia.Languages (`LanguageID`) ON DELETE SET NULL ON UPDATE CASCADE
#	FOREIGN KEY (`LastProject`) REFERENCES Monographia.Projects (`ProjectID`) ON DELETE SET NULL ON UPDATE CASCADE -- Added at the end of this file via an ALTER TABLE statement.
) ENGINE=InnoDB DEFAULT CHARSET=UTF8;
SET @ZEROS = '';
