--
-- Nomenclatural code. DarwinCore 1.4 'NomenclaturalCode'. Data are hard-coded
-- into languages.tsv, thus changes made here must be made there as well.
--
SET foreign_key_checks = 0;
DROP TABLE IF EXISTS `NomenclaturalCodes`;
SET foreign_key_checks = 1;
CREATE TABLE `NomenclaturalCodes` (
	`NomenclaturalCodeID` TINYINT UNSIGNED NOT NULL AUTO_INCREMENT,
	`CodeLong` VARCHAR(255) NOT NULL UNIQUE,
	`CodeShort` VARCHAR(255) NOT NULL UNIQUE,
	`TimeStamp` TIMESTAMP DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
	PRIMARY KEY (`NomenclaturalCodeID`)
) ENGINE=InnoDB DEFAULT CHARSET=UTF8;



--
-- Projects. Projects and all of their data can be deleted (i.e. data cannot be shared between projects without some risk).
--
SET foreign_key_checks = 0;
DROP TABLE IF EXISTS `Projects`;
SET foreign_key_checks = 1;
CREATE TABLE `Projects` (
	`ProjectID` MEDIUMINT UNSIGNED NOT NULL AUTO_INCREMENT,
	`Owner` SMALLINT UNSIGNED NOT NULL, -- non-transferable by regular users (table locking would be reqired)
	`Name` VARCHAR(255) NOT NULL,
	`NomenclaturalCode` TINYINT UNSIGNED NOT NULL, -- DarwinCore 1.4 'NomenclaturalCode'.
	`CITES` TINYINT UNSIGNED NOT NULL, -- Of CITES concern: (1) do not obscure geographic data / (2) do.
	`Aquatic` TINYINT UNSIGNED NOT NULL, -- Used to show/hide fields as appropriate.
	`Terrestrial` TINYINT UNSIGNED NOT NULL, -- Used to show/hide fields as appropriate.
	`Status` TINYINT UNSIGNED, -- 'inactive' (0) / 'active' (1) == changed to active after all tables and triggers are created, could also be used as a 'kill' switch, if needed.
	`Hash` CHAR(16) NOT NULL UNIQUE, -- xxHash(CONCAT(Owner, ' ', Name)); BINARY storage using UNHEX() did not work correctly
	`TimeStamp` TIMESTAMP DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
	PRIMARY KEY (`ProjectID`),
	FOREIGN KEY (`Owner`) REFERENCES Monographia.Users (`UserID`),
	FOREIGN KEY (`NomenclaturalCode`) REFERENCES Monographia.NomenclaturalCodes (`NomenclaturalCodeID`) ON DELETE CASCADE ON UPDATE CASCADE,
	UNIQUE KEY `OwnerName` (`Owner`, `Name`)
) ENGINE=InnoDB DEFAULT CHARSET=UTF8;



