--
-- Places from Open Street Maps.
-- More data at: http://download.geonames.org/export/dump/allCountries.zip
--               http://www.alexandria.ucsb.edu/gazetteer/dgie/DGIE_website/gaz_links.htm
--               http://www.library.mcgill.ca/refshelf/atlas.htm
--               http://www.biogeomancer.org/bg_library/links/gazeteers/
--
SET foreign_key_checks = 0;
DROP TABLE IF EXISTS `Places`;
SET foreign_key_checks = 1;
CREATE TABLE `Places` (
	`PlaceID` INT UNSIGNED NOT NULL AUTO_INCREMENT, -- MapBox.js assumes that values will always be less than Number.MAX_SAFE_INTEGER - 1 (9007199254740990).
	`Coordinates` GEOMETRY NOT NULL, -- The 'center' in WGS84.
	`Feature` SMALLINT UNSIGNED NOT NULL,
	`Elevation` SMALLINT UNSIGNED DEFAULT NULL, -- In meters.
	`Population` INT UNSIGNED DEFAULT NULL,
	`ADM` TINYINT DEFAULT NULL, -- Open Street Maps system.
	`OSMID` INT UNSIGNED NOT NULL, -- Open Street Maps ID.
	`OSMwayID` INT UNSIGNED NOT NULL, -- Open Street Maps Way ID.
	`ModificationDate` DATE,
	PRIMARY KEY (`PlaceID`),
	SPATIAL INDEX(Coordinates),
	FOREIGN KEY (`Feature`) REFERENCES Monographia.Features (`FeatureID`) ON DELETE CASCADE ON UPDATE CASCADE,
	UNIQUE KEY `OSMID` (`OSMID`)
) ENGINE=InnoDB ROW_FORMAT=COMPRESSED KEY_BLOCK_SIZE=8 DEFAULT CHARSET=UTF8;



