--
-- ASTER Global Digital Elevation Model Version 2 (GDEM2; Tachikawa et al. 2011) 50 m shapes. Created with gdem2.sh.
--
SET foreign_key_checks = 0;
DROP TABLE IF EXISTS `GDEM2Shapes`;
SET foreign_key_checks = 1;
CREATE TABLE `GDEM2Shapes` (
	`GDEM2ShapeID` BIGINT UNSIGNED NOT NULL AUTO_INCREMENT,
	`Shape` GEOMETRY NOT NULL, -- In WGS84.
	`ShapeHash` CHAR(128) NOT NULL UNIQUE, -- SHA2(Shape, 512); BINARY storage using UNHEX() did not work correctly
	`Elevation` SMALLINT UNSIGNED NOT NULL,
	PRIMARY KEY (`GDEM2ShapeID`),
	SPATIAL INDEX(Shape)
) ENGINE=InnoDB ROW_FORMAT=COMPRESSED KEY_BLOCK_SIZE=8 DEFAULT CHARSET=UTF8;



--
