--
-- Soil data.
--
SET foreign_key_checks = 0;
DROP TABLE IF EXISTS `SoilData`;
SET foreign_key_checks = 1;
CREATE TABLE `SoilData` (
	`SoilDatumID` MEDIUMINT UNSIGNED NOT NULL AUTO_INCREMENT,
	`Shape` MEDIUMINT UNSIGNED NOT NULL,
	`Type` TINYINT UNSIGNED NOT NULL,
	`Area` DECIMAL(4,3), -- HWSD 'SHARE': fractional share in soil mapping unit
	`TopsoilPercentGravel` TINYINT UNSIGNED, -- HWSD 'T_GRAVEL': percent by volume
	`TopsoilPercentSand` TINYINT UNSIGNED, -- HWSD 'T_SAND': sand = 0.0625–2 mm, percent by weight
	`TopsoilPercentSilt` TINYINT UNSIGNED, -- HWSD 'T_SILT': silt = 0.002–0.0625 mm (or 0.002–0.050 mm for some data), percent by weight
	`TopsoilPercentClay` TINYINT UNSIGNED, -- HWSD 'T_CLAY': clay < 0.002 mm, percent by weight
	`TopsoilBulkDensity` DECIMAL(3,2), -- HWSD 'T_REF_BULK_DENSITY': kg/dm3
	`TopsoilPercentOrganicCarbon` DECIMAL(4,2), -- HWSD 'T_OC': percent by weight
	`TopsoilPH` DECIMAL(3,1), -- HWSD 'T_PH_H2O': pH in water
	`TopsoilClayCationExchangeCapacity` TINYINT UNSIGNED, -- HWSD 'T_CEC_CLAY': cmol/kg
	`TopsoilCationExchangeCapacity` TINYINT UNSIGNED, -- HWSD 'T_CEC_SOIL': cmol/kg
	`TopsoilPercentBaseSaturation` TINYINT UNSIGNED, -- HWSD 'T_BS': exchangeable cations (nutrients) Na, Ca, Mg, and K as a percentage of the overall exchange capacity of the soil
	`TopsoilExchangeableBases` DECIMAL(4,1), -- HWSD 'T_TEB': exchangeable bases (Na, Ca, Mg, and K) in the soil, cmol/kg
	`TopsoilPercentLime` DECIMAL(3,1), -- HWSD 'T_CACO3': percent by weight
	`TopsoilPercentGypsum` DECIMAL(3,1), -- HWSD 'T_CASO4': percent by weight
	`TopsoilPercentExchangeableSodium` TINYINT UNSIGNED, -- HWSD 'T_ESP'
	`TopsoilElectricalConductivity` DECIMAL(4,1), -- HWSD 'T_ECE': dS/m
	`SubsoilPercentGravel` TINYINT UNSIGNED, -- HWSD 'S_GRAVEL': percent by volume
	`SubsoilPercentSand` TINYINT UNSIGNED, -- HWSD 'S_SAND': sand = 0.0625–2 mm, percent by weight
	`SubsoilPercentSilt` TINYINT UNSIGNED, -- HWSD 'S_SILT': silt = 0.002–0.0625 mm (or 0.002–0.050 mm for some data), percent by weight
	`SubsoilPercentClay` TINYINT UNSIGNED, -- HWSD 'S_CLAY': clay < 0.002 mm, percent by weight
	`SubsoilBulkDensity` DECIMAL(3,2), -- HWSD 'S_REF_BULK_DENSITY': kg/dm3
	`SubsoilPercentOrganicCarbon` DECIMAL(4,2), -- HWSD 'S_OC': percent by weight
	`SubsoilPH` DECIMAL(3,1), -- HWSD 'S_PH_H2O': pH in water
	`SubsoilClayCationExchangeCapacity` TINYINT UNSIGNED, -- HWSD 'S_CEC_CLAY': cmol/kg
	`SubsoilCationExchangeCapacity` TINYINT UNSIGNED, -- HWSD 'S_CEC_SOIL': cmol/kg
	`SubsoilPercentBaseSaturation` TINYINT UNSIGNED, -- HWSD 'S_BS': exchangeable cations (nutrients) Na, Ca, Mg, and K as a percentage of the overall exchange capacity of the soil
	`SubsoilExchangeableBases` DECIMAL(3,1), -- HWSD 'S_TEB': exchangeable bases (Na, Ca, Mg, and K) in the soil, cmol/kg
	`SubsoilPercentLime` DECIMAL(3,1), -- HWSD 'S_CACO3': : percent by weight (two values are 127.7, clearly an error, changed to 12.7)
	`SubsoilPercentGypsum` DECIMAL(3,1), -- HWSD 'S_CASO4': percent by weight
	`SubsoilPercentExchangeableSodium` TINYINT UNSIGNED, -- HWSD 'S_ESP'
	`SubsoilElectricalConductivity` DECIMAL(4,1), -- HWSD 'S_ECE': dS/m
	PRIMARY KEY (`SoilDatumID`),
	FOREIGN KEY (`Shape`) REFERENCES SoilShapes (`SoilShapeID`) ON DELETE CASCADE ON UPDATE CASCADE,
	FOREIGN KEY (`Type`) REFERENCES SoilTypes (`SoilTypeID`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB ROW_FORMAT=COMPRESSED KEY_BLOCK_SIZE=8 DEFAULT CHARSET=UTF8;



