--
-- Create new project database.
--
DELIMITER //

DROP PROCEDURE IF EXISTS `CreateDatabase`//
CREATE PROCEDURE CreateDatabase (IN d CHAR(8))
BEGIN
	DECLARE done BOOLEAN DEFAULT FALSE;
	DECLARE t CHAR(32);
	DECLARE c CURSOR FOR SELECT TABLE_NAME FROM information_schema.tables WHERE TABLE_SCHEMA = 'MonographiaTemplates';
	DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;
	SET foreign_key_checks = 0;
	SET @q = CONCAT('DROP DATABASE IF EXISTS MonographiaProject_', d);
	PREPARE s FROM @q;
	EXECUTE s;
	DEALLOCATE PREPARE s;
	SET foreign_key_checks = 1;
	SET @q = CONCAT('CREATE DATABASE MonographiaProject_', d);
	PREPARE s FROM @q;
	EXECUTE s;
	DEALLOCATE PREPARE s;
	OPEN c;
	createTableLoop: LOOP
		FETCH c INTO t;
		IF done THEN
			LEAVE createTableLoop;
		END IF;
		SET @q = CONCAT('CREATE TABLE IF NOT EXISTS MonographiaProject_', d, '.', t, ' LIKE MonographiaTemplates.', t);
		PREPARE s FROM @q;
		EXECUTE s;
		DEALLOCATE PREPARE s;
	END LOOP createTableLoop;
	CLOSE c;
END//



--
-- Add internal foreign keys (compensates for a MySQL bug in CREATE TABLE ... LIKE ...).
-- Does not check if keys exist, so will crash in run more than once on the same tables.
--
DROP PROCEDURE IF EXISTS `AddInternalKeys`//
CREATE PROCEDURE AddInternalKeys (IN d CHAR(8))
BEGIN
	DECLARE done BOOLEAN DEFAULT FALSE;
	DECLARE w CHAR(32);
	DECLARE x CHAR(32);
	DECLARE y CHAR(32);
	DECLARE z CHAR(32);
	DECLARE c CURSOR FOR SELECT TABLE_NAME, COLUMN_NAME, REFERENCED_TABLE_NAME, REFERENCED_COLUMN_NAME FROM information_schema.key_column_usage WHERE TABLE_SCHEMA = 'MonographiaTemplates' AND referenced_column_name IS NOT NULL AND REFERENCED_TABLE_NAME NOT IN (SELECT TABLE_NAME FROM information_schema.key_column_usage WHERE TABLE_SCHEMA = 'Monographia');
	DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;
	OPEN c;
	addInternalKeys: LOOP
		FETCH c INTO w, x, y, z;
		IF done THEN
			LEAVE addInternalKeys;
		END IF;
		SET @q = CONCAT('ALTER TABLE MonographiaProject_', d, '.', w, ' ADD FOREIGN KEY (`', x, '`) REFERENCES MonographiaProject_', d, '.', y, '(`', z, '`)');
		PREPARE s FROM @q;
		EXECUTE s;
		DEALLOCATE PREPARE s;
	END LOOP addInternalKeys;
	CLOSE c;
END//



