--
-- Check user/project permissions and user/project status.
--
DROP FUNCTION IF EXISTS `PERMISSIONS`//
CREATE FUNCTION PERMISSIONS(p MEDIUMINT UNSIGNED, u SMALLINT UNSIGNED, t CHAR(1)) -- ViewData, CreateView, InsertData, EditData, DeleteData, Owner, Associate
RETURNS TINYINT UNSIGNED
READS SQL DATA
NOT DETERMINISTIC
BEGIN
	DECLARE r TINYINT UNSIGNED;
	SET r = 0;
	IF (t = 'v') THEN -- ViewData
		SELECT COUNT(UserID) INTO r FROM Users, UserPermissions, Projects WHERE Users.UserID = UserPermissions.User AND UserPermissions.Project = Projects.ProjectID AND Users.Status = 1 AND Projects.Status = 1 AND ViewData = 1 AND Projects.ProjectID = p AND Users.UserID = u LIMIT 1;
	ELSEIF (t = 'c') THEN -- CreateView
		SELECT COUNT(UserID) INTO r FROM Users, UserPermissions, Projects WHERE Users.UserID = UserPermissions.User AND UserPermissions.Project = Projects.ProjectID AND Users.Status = 1 AND Projects.Status = 1 AND CreateView = 1 AND Projects.ProjectID = p AND Users.UserID = u LIMIT 1;
	ELSEIF (t = 'i') THEN -- InsertData
		SELECT COUNT(UserID) INTO r FROM Users, UserPermissions, Projects WHERE Users.UserID = UserPermissions.User AND UserPermissions.Project = Projects.ProjectID AND Users.Status = 1 AND Projects.Status = 1 AND InsertData = 1 AND Projects.ProjectID = p AND Users.UserID = u LIMIT 1;
	ELSEIF (t = 'e') THEN -- EditData
		SELECT COUNT(UserID) INTO r FROM Users, UserPermissions, Projects WHERE Users.UserID = UserPermissions.User AND UserPermissions.Project = Projects.ProjectID AND Users.Status = 1 AND Projects.Status = 1 AND EditData = 1 AND Projects.ProjectID = p AND Users.UserID = u LIMIT 1;
	ELSEIF (t = 'd') THEN -- DeleteData
		SELECT COUNT(UserID) INTO r FROM Users, UserPermissions, Projects WHERE Users.UserID = UserPermissions.User AND UserPermissions.Project = Projects.ProjectID AND Users.Status = 1 AND Projects.Status = 1 AND DeleteData = 1 AND Projects.ProjectID = p AND Users.UserID = u LIMIT 1;
	ELSEIF (t = 'o') THEN -- Owner
		SELECT COUNT(ProjectID) INTO r FROM Projects WHERE ProjectID = p AND Owner = u LIMIT 1;
	ELSEIF (t = 'a') THEN -- Associate
		SELECT COUNT(UserID) INTO r FROM Users, UserPermissions, Projects WHERE Users.UserID = UserPermissions.User AND UserPermissions.Project = Projects.ProjectID AND Users.Status = 1 AND Projects.Status = 1 AND Projects.ProjectID = p AND Users.UserID = u LIMIT 1;
	END IF;
	RETURN r;
END//

DELIMITER ;



--
-- Triggers for project property and permission modifications (Projects, UsesProjects).
--
DROP TRIGGER IF EXISTS `Monographia_Trigger_Projects_INSERT`;
CREATE TRIGGER Monographia_Trigger_Projects_INSERT AFTER INSERT ON Projects FOR EACH ROW INSERT INTO Modifications SET LastModifier = NEW.Owner, LastModified = NEW.TimeStamp, Project = NEW.ProjectID;
DROP TRIGGER IF EXISTS `Monographia_Trigger_Projects_UPDATE`;
CREATE TRIGGER Monographia_Trigger_Projects_UPDATE AFTER UPDATE ON Projects FOR EACH ROW UPDATE Modifications SET LastModifier = NEW.Owner, LastModified = NEW.TimeStamp WHERE Project = NEW.ProjectID;

DROP TRIGGER IF EXISTS `Monographia_Trigger_UserPermissions_INSERT`;
CREATE TRIGGER Monographia_Trigger_UserPermissions_INSERT AFTER INSERT ON UserPermissions FOR EACH ROW UPDATE Modifications SET LastModifier = (SELECT Owner FROM Projects WHERE ProjectID = NEW.Project), LastModified = NEW.TimeStamp WHERE Project = NEW.Project;
DROP TRIGGER IF EXISTS `Monographia_Trigger_UserPermissions_UPDATE`;
CREATE TRIGGER Monographia_Trigger_UserPermissions_UPDATE AFTER UPDATE ON UserPermissions FOR EACH ROW UPDATE Modifications SET LastModifier = (SELECT Owner FROM Projects WHERE ProjectID = OLD.Project), LastModified = NEW.TimeStamp WHERE Project = OLD.Project;
DROP TRIGGER IF EXISTS `Monographia_Trigger_UserPermissions_DELETE`;
CREATE TRIGGER Monographia_Trigger_UserPermissions_DELETE AFTER DELETE ON UserPermissions FOR EACH ROW UPDATE Modifications SET LastModifier = (SELECT Owner FROM Projects WHERE ProjectID = OLD.Project) WHERE Project = OLD.Project;



