--
-- Publications. To be used for citations that may be included in the literature cited. Uses Basic RIS fields.
-- RIS A2, A3, A4, AN, C2, C3, C4, C5, C6, C7, C8, CA, CN, DB, DP, J1, J2, L3, L4, LA, M1, M2, M3, NV, OP, RP, RI, RN, RP, SE, ST, T3, TA, TT, U1, U2, U3, U4, U5 not supported, but could be included in 'notes'.
-- RIS L1, L2 are provided via 'URLs' table.
-- Deletion of publications results in the deletion of all of associated data.
--
SET foreign_key_checks = 0;
DROP TABLE IF EXISTS `Publications`;
SET foreign_key_checks = 1;
CREATE TABLE `Publications` (
	`PublicationID` SMALLINT UNSIGNED NOT NULL AUTO_INCREMENT,
	`AccessDate` DATE DEFAULT NULL, -- RIS: Y2
	`Author` SMALLINT UNSIGNED DEFAULT NULL, -- RIS: AU
	`BookTitle` VARCHAR(255) DEFAULT NULL, -- RIS BT
	`City` SMALLINT UNSIGNED DEFAULT NULL, -- RIS: CY, AD
	`DOI` VARCHAR(255) DEFAULT NULL, -- RIS: DO
	`Edition` VARCHAR(255) DEFAULT NULL, -- RIS: ET
	`Editor` SMALLINT UNSIGNED DEFAULT NULL, -- RIS: ED
	`EndPage` VARCHAR(255) DEFAULT NULL, -- RIS: EP
	`ISBN` VARCHAR(17) DEFAULT NULL, -- RIS: SN
	`Issue` VARCHAR(255) DEFAULT NULL, -- RIS: IS, CP, M1
	`Mask` TINYINT UNSIGNED DEFAULT 0, -- A 'public' (0) / 'private' (1) switch.
	`Note` VARCHAR(255) DEFAULT NULL, -- RIS: N1
	`Periodical` SMALLINT UNSIGNED DEFAULT NULL, -- RIS: JF
	`PublicationType` TINYINT UNSIGNED NOT NULL, -- RIS: TY
	`Publisher` SMALLINT UNSIGNED DEFAULT NULL, -- RIS: PB
	`School` SMALLINT UNSIGNED DEFAULT NULL, -- RIS: C1
	`StartPage` VARCHAR(255) DEFAULT NULL, -- RIS: SP
	`Title` VARCHAR(255) DEFAULT NULL, -- RIS TI, T1, CT, T2
	`URL` MEDIUMINT UNSIGNED DEFAULT NULL, -- RIS: UR
	`Volume` VARCHAR(255) DEFAULT NULL, -- RIS: VL
	`Year` DATE DEFAULT NULL, -- RIS: Y1, DA, PY
	`Hash` CHAR(16) NOT NULL UNIQUE, -- xxHash(CONCAT(PublicationType, ' ', Author, ' ', Title, ' ', ' ', BookTitle, ' ', Year)); BINARY storage using UNHEX() did not work correctly
	`TimeStamp` TIMESTAMP DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
	`User` SMALLINT UNSIGNED NOT NULL,
	PRIMARY KEY (`PublicationID`),
	FOREIGN KEY (`PublicationType`) REFERENCES Monographia.PublicationTypes (`PublicationTypeID`) ON DELETE CASCADE ON UPDATE CASCADE,
	FOREIGN KEY (`Author`) REFERENCES PeopleLists (`String`) ON DELETE CASCADE ON UPDATE CASCADE,
	FOREIGN KEY (`Editor`) REFERENCES PeopleLists (`String`) ON DELETE CASCADE ON UPDATE CASCADE,
	FOREIGN KEY (`Periodical`) REFERENCES Periodicals (`PeriodicalID`) ON DELETE CASCADE ON UPDATE CASCADE,
	FOREIGN KEY (`Publisher`) REFERENCES Publishers (`PublisherID`) ON DELETE CASCADE ON UPDATE CASCADE,
	FOREIGN KEY (`School`) REFERENCES Schools (`SchoolID`) ON DELETE CASCADE ON UPDATE CASCADE,
	FOREIGN KEY (`URL`) REFERENCES URLs (`URLID`) ON DELETE CASCADE ON UPDATE CASCADE,
	FOREIGN KEY (`City`) REFERENCES Cities (`CityID`) ON DELETE CASCADE ON UPDATE CASCADE,
	FOREIGN KEY (`User`) REFERENCES Monographia.Users (`UserID`)
) ENGINE=InnoDB DEFAULT CHARSET=UTF8;



