--
-- Terminal place names from non–standard sources. DarwinCore 1.4 'Locality'.
-- Place names are standardized as best as possible upon georeference (at least enough to allow DarwinCore 1.4 'Continent',
-- 'WaterBody', 'IslandGroup', and 'Island' to be calculated), but standardization is not strictly enforced as it may destroy information.
--
SET foreign_key_checks = 0;
DROP TABLE IF EXISTS `Locales`;
SET foreign_key_checks = 1;
CREATE TABLE `Locales` (
	`LocaleID` SMALLINT UNSIGNED NOT NULL AUTO_INCREMENT,
	`Coordinates` GEOMETRY NOT NULL, -- The 'center' in WGS84.
	`Feature` SMALLINT UNSIGNED NOT NULL,
	`Elevation` SMALLINT UNSIGNED DEFAULT NULL, -- In meters.
	`ADM` TINYINT DEFAULT NULL, -- Open Street Maps system.
	`TimeStamp` TIMESTAMP DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
	`User` SMALLINT UNSIGNED NOT NULL,
	PRIMARY KEY (`LocaleID`),
	SPATIAL INDEX(Coordinates),
	FOREIGN KEY (`Feature`) REFERENCES Monographia.Features (`FeatureID`) ON DELETE CASCADE ON UPDATE CASCADE,
	FOREIGN KEY (`User`) REFERENCES Monographia.Users (`UserID`) ON UPDATE CASCADE
) ENGINE=InnoDB ROW_FORMAT=COMPRESSED KEY_BLOCK_SIZE=8 DEFAULT CHARSET=UTF8;



--
-- Terminal place names from non–standard sources in multiple languages.
--
SET foreign_key_checks = 0;
DROP TABLE IF EXISTS `NamedLocales`;
SET foreign_key_checks = 1;
CREATE TABLE `NamedLocales` (
	`NamedLocaleID` INT UNSIGNED NOT NULL AUTO_INCREMENT,
	`Locale` SMALLINT UNSIGNED NOT NULL,
	`Prefix` SMALLINT UNSIGNED DEFAULT NULL,
	`Name` VARCHAR(255) NOT NULL,
	`Suffix` SMALLINT UNSIGNED DEFAULT NULL,
	`Language` TINYINT UNSIGNED NOT NULL,
	`TimeStamp` TIMESTAMP DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
	`User` SMALLINT UNSIGNED NOT NULL,
	PRIMARY KEY (`NamedLocaleID`),
	FOREIGN KEY (`Locale`) REFERENCES Locales (`LocaleID`) ON DELETE CASCADE ON UPDATE CASCADE,
	FOREIGN KEY (`Prefix`) REFERENCES Monographia.GeographicPrefixes (`GeographicPrefixID`) ON UPDATE CASCADE,
	FOREIGN KEY (`Suffix`) REFERENCES Monographia.GeographicSuffixes (`GeographicSuffixID`) ON UPDATE CASCADE,
	FOREIGN KEY (`Language`) REFERENCES Monographia.Languages (`LanguageID`) ON DELETE CASCADE ON UPDATE CASCADE,
	FOREIGN KEY (`User`) REFERENCES Monographia.Users (`UserID`) ON UPDATE CASCADE
) ENGINE=InnoDB ROW_FORMAT=COMPRESSED KEY_BLOCK_SIZE=8 DEFAULT CHARSET=UTF8;



--
-- Shapes from non–standard sources.
--
SET foreign_key_checks = 0;
DROP TABLE IF EXISTS `Shapes`;
SET foreign_key_checks = 1;
CREATE TABLE `Shapes` (
