	`Ancestor` INT UNSIGNED NOT NULL,
	`Descendent` INT UNSIGNED NOT NULL,
	`Distance` TINYINT UNSIGNED NOT NULL,
	`TimeStamp` TIMESTAMP DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
