	FOREIGN KEY (`Ancestor`) REFERENCES Monographia.Places (`PlaceID`) ON DELETE CASCADE ON UPDATE CASCADE,
	FOREIGN KEY (`Descendent`) REFERENCES Monographia.Places (`PlaceID`) ON DELETE CASCADE ON UPDATE CASCADE,
	FOREIGN KEY (`User`) REFERENCES Monographia.Users (`UserID`) ON UPDATE CASCADE,
