) ENGINE=InnoDB DEFAULT CHARSET=UTF8;



--
-- Locations at which specimens were collected.
-- This database does not have a 'HigherGeography' field per se, but a construct of all fields can be output.
-- DarwinCore 1.4 'PointRadiusSpatialFit', 'VerbatimCoordinateSystem', and 'VerbatimCoordinates' can be calculated from the data in this table.
-- Locations used for collections cannot be deleted without significant data loss.
--
SET foreign_key_checks = 0;
DROP TABLE IF EXISTS `Locations`;
SET foreign_key_checks = 1;
CREATE TABLE `Locations` (
	`LocationID` SMALLINT UNSIGNED NOT NULL AUTO_INCREMENT,
	`Coordinates` GEOMETRY NOT NULL, -- In WGS84. Large geographic areas do not usually have meaningful coordinates. DarwinCore 1.4 'DecimalLatitude' and 'DecimalLongitude'.
	`CoordinatesEntered` VARCHAR(255) DEFAULT NULL, -- User entered data in its original format. DarwinCore 1.4 'VerbatimLatitude' and 'VerbatimLongitude'.
	`CoordinatesEnteredDatum` SMALLINT UNSIGNED DEFAULT NULL, -- DarwinCore 1.4 'GeodeticDatum'.
	`CoordinateUncertainty` MEDIUMINT UNSIGNED DEFAULT NULL, -- In meters (earth radius = 6,371,000 m). DarwinCore 1.4 'CoordinateUncertaintyInMeters'.
	`GeoreferenceProtocol` TINYINT UNSIGNED DEFAULT NULL, -- DarwinCore 1.4 'GeoreferenceProtocol'.
	`GeoRefenceNote` VARCHAR(255) DEFAULT NULL, -- DarwinCore 1.4 'GeoreferenceRemarks'
	`GeoreferenceVerification` TINYINT UNSIGNED NOT NULL, -- DarwinCore 1.4 'GeoreferenceVerificationStatus'.
	`GeoreferenceFootprint` GEOMETRY DEFAULT NULL, -- WGS84. DarwinCore 1.4 'FootprintWKT'
	`GeoreferenceFootprintFit` DECIMAL(5,4) UNSIGNED DEFAULT NULL, -- DarwinCore 1.4 'FootprintSpatialFit'
	`MinimumElevation` SMALLINT UNSIGNED DEFAULT NULL, -- In meters. DarwinCore 1.4 'MinimumElevationInMeters'.
	`MaximumElevation` SMALLINT UNSIGNED DEFAULT NULL, -- In meters. DarwinCore 1.4 'MaximumElevationInMeters'.
	`ElevationEntered` SMALLINT UNSIGNED DEFAULT NULL, -- DarwinCore 1.4 'VerbatimElevation'
	`ElevationEnteredUnits` TINYINT UNSIGNED DEFAULT NULL, -- DarwinCore 1.4 'VerbatimElevation'
	`MinimumDepth` SMALLINT UNSIGNED DEFAULT NULL, -- In meters. DarwinCore 1.4 'MinimumDepthInMeters'.
	`MaximumDepth` SMALLINT UNSIGNED DEFAULT NULL, -- In meters. DarwinCore 1.4 'MaximumDepthInMeters'.
	`DepthEntered` SMALLINT UNSIGNED DEFAULT NULL, -- DarwinCore 1.4 'VerbatimDepth'
	`DepthEnteredUnits` TINYINT UNSIGNED DEFAULT NULL, -- DarwinCore 1.4 'VerbatimDepth'
	`Location` SMALLINT UNSIGNED NOT NULL,  -- DarwinCore 1.4 'Locality'.
	`LocationEntered` VARCHAR(255) DEFAULT NULL, -- Location data as entered. DarwinCore 1.4 'Locality'.
	`Mask` TINYINT UNSIGNED DEFAULT 0, -- A 'public' (0) / 'private' (1) switch.
	`TimeStamp` TIMESTAMP DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
	`User` SMALLINT UNSIGNED NOT NULL,
	PRIMARY KEY (`LocationID`),
	SPATIAL INDEX(Coordinates),
	FOREIGN KEY (`CoordinatesEnteredDatum`) REFERENCES Monographia.GeodeticData (`GeodeticDatumID`) ON DELETE CASCADE ON UPDATE CASCADE,
	FOREIGN KEY (`GeoreferenceProtocol`) REFERENCES Monographia.GeoreferenceTypes (`GeoreferenceTypeID`) ON DELETE CASCADE ON UPDATE CASCADE,
	FOREIGN KEY (`GeoreferenceVerification`) REFERENCES Monographia.GeoreferenceVerifications (`GeoreferenceVerificationID`) ON DELETE CASCADE ON UPDATE CASCADE,
	FOREIGN KEY (`DepthEnteredUnits`) REFERENCES Monographia.Units (`UnitID`) ON DELETE CASCADE ON UPDATE CASCADE,
	FOREIGN KEY (`ElevationEnteredUnits`) REFERENCES Monographia.Units (`UnitID`) ON DELETE CASCADE ON UPDATE CASCADE,
	FOREIGN KEY (`Location`) REFERENCES LocationHierarchies (`LocationHierarchyID`) ON DELETE CASCADE ON UPDATE CASCADE,
	FOREIGN KEY (`User`) REFERENCES Monographia.Users (`UserID`) ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=UTF8;



