-- -- -- COLLECTION AND SPECIMEN TABLE TEMPLATES
-- -- --

--
-- As defined here, a collection is a gathering from a particular place at a particular
-- time by a person or set of persons. DarwinCore 1.4 'DayOfYear', 'EarliestDateCollected'
-- and 'LatestDateCollected' can be construced from the Date and SecondDate fields.
-- Deletion of a collecting event deletes all associated data.
--
SET foreign_key_checks = 0;
DROP TABLE IF EXISTS `Collections`;
SET foreign_key_checks = 1;
CREATE TABLE `Collections` (
	`CollectionID` SMALLINT UNSIGNED NOT NULL AUTO_INCREMENT,
	`Location` SMALLINT UNSIGNED NOT NULL,
	`Collector` SMALLINT UNSIGNED DEFAULT NULL,
	`CollectionNumber` VARCHAR(255) DEFAULT NULL,
	`Date` DATETIME DEFAULT NULL,
	`SecondDate` DATETIME DEFAULT NULL,
	`DateEntered` VARCHAR(255) DEFAULT NULL, -- DarwinCore 1.4 'VerbatimCollectingDate'
	`NaturalState` TINYINT UNSIGNED DEFAULT NULL, -- DarwinCore 1.4 'ValidDistributionFlag' (with additional information).
	`Note` VARCHAR(255) DEFAULT NULL, -- DarwinCore 1.4 'Remarks'.
	`TimeStamp` TIMESTAMP DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
	`User` SMALLINT UNSIGNED NOT NULL,
	PRIMARY KEY (`CollectionID`),
	FOREIGN KEY (`Location`) REFERENCES Locations (`LocationID`) ON DELETE CASCADE ON UPDATE CASCADE,
	FOREIGN KEY (`Collector`) REFERENCES PeopleLists (`PeopleListID`) ON DELETE CASCADE ON UPDATE CASCADE,
	FOREIGN KEY (`NaturalState`) REFERENCES Monographia.NaturalStates (`NaturalStateID`) ON DELETE CASCADE ON UPDATE CASCADE,
	FOREIGN KEY (`User`) REFERENCES Monographia.Users (`UserID`) ON UPDATE CASCADE,
	UNIQUE KEY `Collections` (`Location`, `Collector`, `CollectionNumber`, `Date`)
) ENGINE=InnoDB DEFAULT CHARSET=UTF8;



