CREATE TABLE `Specimens` (
	`SpecimenID` MEDIUMINT UNSIGNED NOT NULL AUTO_INCREMENT, -- MapBox.js assumes that values will always be less than Number.MAX_SAFE_INTEGER - 1 (9007199254740990).
	`PreparationDerivative` SMALLINT UNSIGNED NOT NULL,
	`SpecimenType` TINYINT UNSIGNED NOT NULL,
