	FOREIGN KEY (`User`) REFERENCES Monographia.Users (`UserID`) ON UPDATE CASCADE,
	UNIQUE KEY `Specimen` (`PreparationDerivative`, `SpecimenType`)
) ENGINE=InnoDB DEFAULT CHARSET=UTF8;



