-- Dynamic content: graphs.
--
SET foreign_key_checks = 0;
DROP TABLE IF EXISTS `GraphContents`;
SET foreign_key_checks = 1;
CREATE TABLE `GraphContents` (
	`GraphContentID` SMALLINT UNSIGNED NOT NULL AUTO_INCREMENT,
	`Content` SMALLINT UNSIGNED NOT NULL,
	`Height` SMALLINT UNSIGNED NOT NULL, -- mm
	`Width` SMALLINT UNSIGNED NOT NULL, -- mm
	`GraphStyle` TINYINT UNSIGNED NOT NULL,
	`GraphType` TINYINT UNSIGNED NOT NULL,
	`TimeStamp` TIMESTAMP DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
	`User` SMALLINT UNSIGNED NOT NULL,
	PRIMARY KEY (`GraphContentID`),
	FOREIGN KEY (`Content`) REFERENCES Contents (`ContentID`) ON DELETE CASCADE ON UPDATE CASCADE,
	FOREIGN KEY (`GraphStyle`) REFERENCES Monographia.GraphStyles (`GraphStyleID`) ON DELETE CASCADE ON UPDATE CASCADE,
	FOREIGN KEY (`GraphType`) REFERENCES Monographia.GraphTypes (`GraphTypeID`) ON DELETE CASCADE ON UPDATE CASCADE,
	FOREIGN KEY (`User`) REFERENCES Monographia.Users (`UserID`) ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=UTF8;



--
-- Precomputed graphs.
--
SET foreign_key_checks = 0;
DROP TABLE IF EXISTS `Graphs`;
SET foreign_key_checks = 1;
CREATE TABLE `Graphs` (
	`GraphID` SMALLINT UNSIGNED NOT NULL AUTO_INCREMENT,
	`Content` SMALLINT UNSIGNED NOT NULL,
	`Graph` BLOB NOT NULL,
	`TimeStamp` TIMESTAMP DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
	PRIMARY KEY (`GraphID`),
	FOREIGN KEY (`Content`) REFERENCES Contents (`ContentID`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=UTF8;
