--
-- Dynamic content: critical discussion characters.
--
SET foreign_key_checks = 0;
DROP TABLE IF EXISTS `CriticalContents`;
SET foreign_key_checks = 1;
CREATE TABLE `CriticalContents` (
	`CriticalContentID` SMALLINT UNSIGNED NOT NULL AUTO_INCREMENT,
	`CriticalDiscussion` SMALLINT UNSIGNED NOT NULL,
	`Ancestor` MEDIUMINT UNSIGNED NOT NULL,
	`Descendent` MEDIUMINT UNSIGNED NOT NULL,
	`Distance` TINYINT UNSIGNED NOT NULL,
	`TimeStamp` TIMESTAMP DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
	`User` SMALLINT UNSIGNED NOT NULL,
	PRIMARY KEY (`CriticalContentID`),
	KEY `CriticalDiscussion` (`CriticalDiscussion`),
	FOREIGN KEY (`Ancestor`) REFERENCES CharacterGroups (`CharacterGroupID`) ON DELETE CASCADE ON UPDATE CASCADE,
	FOREIGN KEY (`Descendent`) REFERENCES CharacterGroups (`CharacterGroupID`) ON DELETE CASCADE ON UPDATE CASCADE,
	FOREIGN KEY (`User`) REFERENCES Monographia.Users (`UserID`) ON UPDATE CASCADE,
	UNIQUE KEY `CriticalDiscussionkey` (`CriticalDiscussion`, `Ancestor`, `Descendent`)
) ENGINE=InnoDB DEFAULT CHARSET=UTF8;



--
-- Dynamic content: critical discussions.
--
SET foreign_key_checks = 0;
